CREATE TABLE continents (
    id integer NOT NULL,
    name character varying(200) NOT NULL
);

CREATE TABLE matches (
    id integer NOT NULL,
    home character(3) NOT NULL,
    away character(3) NOT NULL,
    datetime timestamp without time zone NOT NULL,
    stage integer NOT NULL
);

CREATE TABLE nationalteams (
    short_name character(3) NOT NULL,
    name character varying(200) NOT NULL,
    group_phase character(1) NOT NULL,
    continent integer
);

CREATE TABLE players (
    id integer NOT NULL,
    name character varying(100) NOT NULL,
    birth_year integer,
    playing_position character varying(10) DEFAULT NULL::character varying,
    local_club character varying(100) DEFAULT NULL::character varying,
    national_team character(3) NOT NULL
);

CREATE TABLE scores (
    id integer NOT NULL,
    match_id integer NOT NULL,
    team_id character(3) NOT NULL,
    player_id integer NOT NULL,
    minute integer,
    score_type integer
);

CREATE TABLE stages (
    id integer NOT NULL,
    name character varying(100) DEFAULT NULL::character varying
);







ALTER TABLE ONLY continents
    ADD CONSTRAINT continents_pkey PRIMARY KEY (id);

ALTER TABLE ONLY matches
    ADD CONSTRAINT matches_pkey PRIMARY KEY (id);

ALTER TABLE ONLY nationalteams
    ADD CONSTRAINT nationalteams_pkey PRIMARY KEY (short_name);

ALTER TABLE ONLY players
    ADD CONSTRAINT players_pkey PRIMARY KEY (id);

ALTER TABLE ONLY scores
    ADD CONSTRAINT scores_pkey PRIMARY KEY (id);

ALTER TABLE ONLY stages
    ADD CONSTRAINT stages_pkey PRIMARY KEY (id);

ALTER TABLE ONLY matches
    ADD CONSTRAINT matches_away_fkey FOREIGN KEY (away) REFERENCES public.nationalteams(short_name);

ALTER TABLE ONLY matches
    ADD CONSTRAINT matches_home_fkey FOREIGN KEY (home) REFERENCES public.nationalteams(short_name);

ALTER TABLE ONLY nationalteams
    ADD CONSTRAINT nationalteams_continent_fkey FOREIGN KEY (continent) REFERENCES public.continents(id);

ALTER TABLE ONLY players
    ADD CONSTRAINT players_national_team_fkey FOREIGN KEY (national_team) REFERENCES public.nationalteams(short_name);

ALTER TABLE ONLY scores
    ADD CONSTRAINT scores_match_id_fkey FOREIGN KEY (match_id) REFERENCES public.matches(id);

ALTER TABLE ONLY scores
    ADD CONSTRAINT scores_player_id_fkey FOREIGN KEY (player_id) REFERENCES public.players(id);

ALTER TABLE ONLY scores
    ADD CONSTRAINT scores_team_id_fkey FOREIGN KEY (team_id) REFERENCES public.nationalteams(short_name);

